  \"great-dismal-swamp-national-wildlife-refuge-annual-narrative-report-calendar-year-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Great
  Dismal Swamp National Wildlife Refuge outlines Refuge accomplishments during the
  1989 calendar year. The report begins with a summary of the year's highlights and
  weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, the management plan, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given. Habitat management is also covered; subjects include
  wetlands, forests, fire management, water rights, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, and disease control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, fishing, wildlife
  observation, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, communication systems, and computer systems.
  Cooperative programs and items of interest are provided at the end. Refuge brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
